import React from "react";
import "./NavFixBottom.css";

const NavFixBottom = () => {
  return (
    <nav class="navbar fixed-bottom navbar-light bg-light">
    <a class="navbar-brand" href="#">Fixed bottom</a>
  </nav>
  );
};

export default NavFixBottom;
